import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Button, Image, Col} from 'react-bootstrap';
import logo from '../../res/23619.jpeg';
import './home.css';
import LeafsComponents from './subcomponents/LeafsComponents';
const Home = () => {
  return (
    <div style={{position: 'relative'}}>
      <img object-fit="contain" src={logo} class="sliderImage" />
      <LeafsComponents />
      <div
        style={{
          justifyContent: 'center',
          justifyItems: 'center',
          display: 'flex',
        }}
      >
        <Card style={{width: '90%', margin: 20}}>
          <Card.Header as="h5">EXPLORE CANADA</Card.Header>
          <Form
            inline
            style={{
              paddingLeft: 20,
              paddingRight: 20,
              paddingTop: 10,
              paddingBottom: 10,
            }}
          >
            <Form.Row className="center">
              <Col sm={3}>
                <Form.Control
                  type="text"
                  placeholder="SEARCH BY CITY NAME"
                  style={{}}
                />
              </Col>
              <Col sm={4}>
                <Form.Group controlId="formGroupCheckIn" style={{}}>
                  <Form.Label style={{fontSize: 14, fontWeight: 'bold'}}>
                    Check In
                  </Form.Label>
                  <Form.Control type="date" placeholder="Start Date" />
                </Form.Group>
              </Col>
              <Col sm={4}>
                <Form.Group controlId="formGroupCheckout" style={{}}>
                  <Form.Label style={{fontSize: 14, fontWeight: 'bold'}}>
                    Check Out
                  </Form.Label>
                  <Form.Control type="date" placeholder="End Date" />
                </Form.Group>
              </Col>
              <Col sm={1}>
                <Button style={{height: 40}}>Search</Button>
              </Col>
            </Form.Row>
          </Form>
        </Card>
      </div>
    </div>
  );
};
export default Home;
